import { initIngredients } from "../actions";
import * as actionTypes from "../actions/actionTypes";



const initialState = {
    msg: {},
    status: null,
    id: null
}

const  reducer = (state = initIngredients, action) => {
    switch(action.type) {
        case actionTypes.GET_ERROR:
            return {
                msg: action.payload.msg,
                status: action.pa
            }
    }
}

export default reducer;
